pragma solidity >=0.4.21 <0.6.0;

contract ticketingSystem {



	struct Artist{
		uint iD;
		bytes32 name;
		uint category;
		address owner;
	}

	mapping  (uint => Artist) public artistsRegister;
	uint nextID=1;

	/*constructor () public {
		nextID = 1;
	}*/

	function createArtist(bytes32 _name, uint _category) public {

		artistsRegister[nextID].iD = nextID;
		artistsRegister[nextID].name = _name;
		artistsRegister[nextID].category = _category;
		artistsRegister[nextID].owner = msg.sender;

		nextID ++;
	}


	function modifyArtist(uint _artistID, bytes32 _newName, uint _newCategory) public {
		require(artistsRegister[_artistID].owner == msg.sender);

		artistsRegister[_artistID].name = _newName;
		artistsRegister[_artistID].category = _newCategory;

	}

}
